import React from "react";
import "./App.css";

import Stories from "./Stories";
import SearchStories from "./SearchStories";

const App = () => (

  <div className="app">
                  <div
                    style={{
                      display: "flex",
                      justifyContent: "center",
                      alignItems: "center",
                      fontstyle: 'italic'

                    }}
                  >
                    Search a topic to get stories shared on Hacker News
                  </div>
    <div className="interactions">
      <SearchStories />
    </div>
    <Stories />
  </div>
);

export default App;
